import React from "react";

import "./Card.css";

export const Card = ({
  symbol,
  meaning,
}) => {
  return (
    <div className="card-container">
      {imgSrc && imgAlt && (
        <img src={imgSrc} alt={imgAlt} className="card-img" />
      )}
      {symbol && <h1 className="card-symbol">{symbol}</h1>}
      {meaning && <p className="card-meaning">{meaning}</p>}
    </div>
  );
};
